// Store in a global so we don't bloat storage while working on the IBIS app by saving the images each time we save the app
const CompendiumIcons = {}
window.CompendiumIcons = CompendiumIcons

CompendiumIcons.trashbinfull_png = "data:image/png;base64,"
CompendiumIcons.trashbin_png = "data:image/png;base64,"
CompendiumIcons.reference_png = "data:image/png;base64,"
CompendiumIcons.position2_png = "data:image/png;base64,"
CompendiumIcons.position_png = "data:image/png;base64,"
CompendiumIcons.plus_png = "data:image/png;base64,"
CompendiumIcons.note_png= "data:image/png;base64,"
CompendiumIcons.minus_png = "data:image/png;base64,"
CompendiumIcons.map_png = "data:image/png;base64,"
CompendiumIcons.list_png = "data:image/png;base64,"
CompendiumIcons.issue_png = "data:image/png;base64,"
CompendiumIcons.decision_png = "data:image/png;base64,"
CompendiumIcons.decision_old_png = "data:image/png;base64,"
CompendiumIcons.argument_png = "data:image/png;base64,"

Twirlip7.show(() => {
    return Object.keys(CompendiumIcons).map((key) => {
        return m("img.ma1", {src: CompendiumIcons[key], alt: key.substring(0, key.length - 4) + " icon"})
    })
}, ".bg-blue.br4")
